 ('1', '2', '1', '1', 'en_us', '1', NULL, '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1488661519,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-03-04 21:05:19', '2017-03-04 21:05:19', '03e99fd7-bbca-4feb-91a6-d8a052b3791d'),
 ('2', '2', '1', '1', 'en_us', '2', NULL, '{\"typeId\":null,\"authorId\":null,\"title\":\"Welcome to Localhost!\",\"slug\":\"homepage\",\"postDate\":1488661519,\"expiryDate\":null,\"enabled\":\"1\",\"parentId\":null,\"fields\":{\"1\":\"<p>It\\u2019s true, this site doesn\\u2019t have a whole lot of content yet, but don\\u2019t worry. Our web developers have just installed the CMS, and they\\u2019re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.<\\/p>\"}}', '2017-03-04 21:05:20', '2017-03-04 21:05:20', '4b9432f7-8b51-41ff-a10a-a803f55e8e88'),
 ('3', '3', '2', '1', 'en_us', '1', NULL, '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1488661520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-03-04 21:05:20', '2017-03-04 21:05:20', '5823d36e-2011-45e1-ad3b-de95b3abe18d'),
 ('4', '3', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1488661500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Craft is the CMS that\\u2019s powering Localhost. It\\u2019s beautiful, powerful, flexible, and easy-to-use, and it\\u2019s made by Pixel & Tonic. We can\\u2019t wait to dive in and see what it\\u2019s capable of!<\\/p>\\r\\n<hr class=\\\"redactor_pagebreak\\\" style=\\\"display:none\\\" unselectable=\\\"on\\\" contenteditable=\\\"false\\\">\\r\\n<p>This is even more captivating content, which you couldn\\u2019t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.<\\/p>\\r\\n<p>Craft: a nice alternative to Word, if you\\u2019re making a website.<\\/p>\",\"2\":\"\"}}', '2017-03-04 21:10:43', '2017-03-04 21:10:43', 'a234287c-4a1f-4b81-a070-4fa0540fb60d'),
